  - class: StructConfiguration
    values: [!!python/unicode 'structquaternion__struct', !!python/unicode 'Quaternion',
      !!python/unicode '', !!python/unicode 'quaternion_struct', !!python/unicode "#ifndef\
        \ _INC_STRUCT_QUATERNION\n#define _INC_STRUCT_QUATERNION\n\ntypedef struct\
        \ quaternion_struct {\n\tfloat fw;\n\tfloat fx;\n\tfloat fy;\n\tfloat fz;\n\
        } quaternion_struct;\n\n#endif", !!python/unicode "import Data.Bits\nimport\
        \ HGamer3D.Data.Vector\n\nnewtype Quat = Quat Quaternion\n\ninstance Storable\
        \ Quat where\n  alignment _ = alignment (undefined :: CDouble)\n  sizeOf _\
        \ = {#sizeof quaternion_struct#}\n  peek p = do\n\tfw <- {#get quaternion_struct.fw\
        \ #} p\n\tfx <- {#get quaternion_struct.fx #} p\n\tfy <- {#get quaternion_struct.fy\
        \ #} p\n\tfz <- {#get quaternion_struct.fz #} p\n\tlet q = Quat ( Q (Vec4\
        \ (realToFrac fw) (realToFrac fx) (realToFrac fy) (realToFrac fz) ))\n\treturn\
        \ q\n  poke p (Quat (Q ( Vec4 w x y z))) = do\n    {#set quaternion_struct.fw\
        \ #} p (realToFrac w)\n    {#set quaternion_struct.fx #} p (realToFrac x)\n\
        \    {#set quaternion_struct.fy #} p (realToFrac y)\n    {#set quaternion_struct.fz\
        \ #} p (realToFrac z)\n \ntype QuatPtr = Ptr (Quat)\n\n{#pointer *quaternion_struct\
        \ as QuaternionPtr -> Quaternion #}\n\nwithQuaternion :: Quaternion -> (QuaternionPtr\
        \ -> IO b) -> IO b\nwithQuaternion q f = with q' f' where\n     q' = Quat\
        \ q\n     f' p = f (castPtr p)\npeekQuaternion p = do\n   (Quat q) <- peek\
        \ ((castPtr p)::QuatPtr)\n   return q\n\n\n", !!python/unicode 'Quaternion',
      true, !!python/unicode '']
  - class: StructConfiguration
    values: [!!python/unicode 'structvector2__struct', !!python/unicode 'Vec2', !!python/unicode '',
      !!python/unicode 'vector2_struct', !!python/unicode "#ifndef _INC_STRUCT_VECTOR2\n\
        #define _INC_STRUCT_VECTOR2\n\ntypedef struct vector2_struct {\n\tfloat x;\n\
        \tfloat y;\n} vector2_struct;\n\n#endif", !!python/unicode "import Data.Bits\n\
        import HGamer3D.Data.Vector\n\nnewtype Vector2 = Vector2 Vec2\n\ninstance\
        \ Storable Vector2 where\n  alignment _ = alignment (undefined :: CDouble)\n\
        \  sizeOf _ = {#sizeof vector2_struct#}\n  peek p = do\n\tx <- {#get vector2_struct.x\
        \ #} p\n\ty <- {#get vector2_struct.y #} p\n\tlet v = Vector2 ( Vec2 (realToFrac\
        \ x) (realToFrac y))\n\treturn v\n  poke p (Vector2 (Vec2 x y)) = do\n   \
        \ {#set vector2_struct.x #} p (realToFrac x)\n    {#set vector2_struct.y #}\
        \ p (realToFrac y)\n\ntype Vector2Ptr = Ptr (Vector2)\n    \n{#pointer *vector2_struct\
        \ as Vec2Ptr -> Vec2 #}\n\nwithVec2 :: Vec2 -> (Vec2Ptr -> IO b) -> IO b\n\
        withVec2 v f = with v' f' where\n     v' = Vector2 v\n     f' p = f (castPtr\
        \ p)\npeekVec2 :: Vec2Ptr -> IO Vec2\npeekVec2 p = do\n   (Vector2 v2) <-\
        \ peek ((castPtr p)::Vector2Ptr)\n   return v2\n\n", !!python/unicode 'Vector2',
      true, !!python/unicode '']
