  - class: StructConfiguration
    values: [!!python/unicode 'structsharedptr__struct', !!python/unicode 'SharedPtr',
      !!python/unicode '', !!python/unicode 'sharedptr_struct', !!python/unicode "#ifndef\
        \ _INC_STRUCT_SHAREDPTR\n#define _INC_STRUCT_SHAREDPTR\n\ntypedef struct sharedptr_struct\
        \ {\n\tvoid* pT;\n\tvoid* pCount;\n\tvoid* pFreeFunc;\n} sharedptr_struct;\n\
        \n#endif", !!python/unicode "import Data.Bits\n\ndata SharedPtr = SharedPtr\
        \ {\n  spPT :: Ptr (),\n  spPCount :: Ptr (),\n  spPFreeFunc :: Ptr ()\n \
        \ } deriving (Eq, Show)\n\ninstance Storable SharedPtr where\n  alignment\
        \ _ = alignment (undefined :: CDouble)\n  sizeOf _ = {#sizeof sharedptr_struct#}\n\
        \  peek p = do\n\tpt <- {#get sharedptr_struct.pT #} p\n\tpc <- {#get sharedptr_struct.pCount\
        \ #} p\n\tpf <- {#get sharedptr_struct.pFreeFunc #} p\n\tlet sp = SharedPtr\
